import React from 'react';
import logo from './logo.svg';
import './App.css';
import './Navigation/Navigation';
import './Navigation/Navigation.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="menu-container"> 
          <div>Home</div>
          <div>Work</div>
          <div>Goals</div>
          <div>Hobbies</div>
          <div>Sports</div>
          <div>Analytics</div>
        </div>
      </header>
    </div>
  );
}

export default App;
